import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { useAuth } from '../context/AuthContext';

const DashboardPage = () => {
  const { user } = useAuth();
  const [rewards, setRewards] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchRewards = async () => {
      try {
        const res = await axios.get('http://localhost:5000/api/rewards');
        setRewards(res.data.data);
      } catch (err) {
        console.error('Error fetching rewards:', err);
      } finally {
        setLoading(false);
      }
    };

    fetchRewards();
  }, []);

  const handleRedeem = async (rewardId) => {
    try {
      await axios.post(`http://localhost:5000/api/rewards/${rewardId}/redeem`);
      alert('Recompensa resgatada com sucesso!');
      // Atualizar pontos do usuÃ¡rio
      window.location.reload();
    } catch (err) {
      alert(err.response?.data?.message || 'Erro ao resgatar recompensa');
    }
  };

  if (loading) {
    return <div>Carregando...</div>;
  }

  return (
    <div className="container mt-4">
      <div className="row">
        <div className="col-md-4">
          <div className="card mb-4">
            <div className="card-body text-center">
              <h3>Seus Pontos</h3>
              <h1 className="display-4">{user?.points || 0}</h1>
              <p className="text-muted">Continue ajudando para ganhar mais!</p>
            </div>
          </div>

          <div className="card">
            <div className="card-header">
              <h4>Suas EstatÃ­sticas</h4>
            </div>
            <div className="card-body">
              <ul className="list-group list-group-flush">
                <li className="list-group-item d-flex justify-content-between align-items-center">
                  Perguntas feitas
                  <span className="badge bg-primary rounded-pill">14</span>
                </li>
                <li className="list-group-item d-flex justify-content-between align-items-center">
                  Respostas dadas
                  <span className="badge bg-primary rounded-pill">23</span>
                </li>
                <li className="list-group-item d-flex justify-content-between align-items-center">
                  Respostas aceitas
                  <span className="badge bg-primary rounded-pill">5</span>
                </li>
              </ul>
            </div>
          </div>
        </div>

        <div className="col-md-8">
          <div className="card mb-4">
            <div className="card-header">
              <h4>Recompensas DisponÃ­veis</h4>
            </div>
            <div className="card-body">
              {rewards.length > 0 ? (
                <div className="row">
                  {rewards.map((reward) => (
                    <div key={reward._id} className="col-md-6 mb-3">
                      <div className="card h-100">
                        <div className="card-body">
                          <h5 className="card-title">{reward.name}</h5>
                          <p className="card-text">{reward.description}</p>
                          <div className="d-flex justify-content-between align-items-center">
                            <span className="badge bg-warning text-dark">
                              {reward.pointsRequired} pontos
                            </span>
                            <button
                              className="btn btn-sm btn-success"
                              onClick={() => handleRedeem(reward._id)}
                              disabled={user.points < reward.pointsRequired}
                            >
                              Resgatar
                            </button>
                          </div>
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              ) : (
                <p>Nenhuma recompensa disponÃ­vel no momento.</p>
              )}
            </div>
          </div>

          <div className="d-grid gap-2">
            <Link to="/ask" className="btn btn-primary btn-lg">
              Fazer uma Pergunta
            </Link>
            <Link to="/questions" className="btn btn-secondary btn-lg">
              Responder Perguntas
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default DashboardPage;
